    <Box width={"100%"} display="flex">
     { bookings && bookings.length >0 && (<Box width={"30%"} flexDirection={'column'} justifyContent="center" alignItems={"center"}>
     <AccountCircleIcon  sx={{fontSize :"10rem"}}/>
     
     
     </Box>)}
    </Box>
  )
}

